body.div:
			Πῶς ἔτι ταῦτα, φησίν, ἐκ τῶν πολυθρυλήτων ἀρχῶν δύνανται ποιεῖν;
τί γὰρ ἐν τούτοις τὸ ὑπερέχον καὶ <τί> τὸ ἐλλεῖπον; τὸ μὲν οὖν περὶ
γωνιῶν καὶ πρόχειρόν ἐστιν· ὅτι γὰρ ἡ ὀρθὴ κατὰ τὴν μονάδα μᾶλλον,

			Tίς ἐστιν ὁ φυγών; διὰ τί μάτην ὀνειδίζεται ὁ χρυσοῦς Σπεύσιππος;
πῶς δὲ εἵπετο ἐκ τοιούτων ἐναντίων εἶναι τὴν τῶν θείων πραγμάτων ὑπόστασιν;
οἱ δὲ . . . φύσιν. εὐφήμει· τὸ γὰρ ἄνισον, ὃ ἐπὶ τῆς αἰτίας
